sources.blocks/button/button.scss:
// @import "./../../includes/variables.scss";

$button-outlined-color: red;
$button-main-color: #14d465;
$button-text-main-color: #ffffff;
$hover-button-main-color: #6fcf97;
$button-secondary-color: #0077ff;
$button-secondary-font-color: #ffffff;
$hover-button-secondary-color: #3392FF;
$hover-button-secondary-font-color: #ffffff;


.button {
  height: 50px;
  width: 100%;
  border-radius: 8px;
  border: 0;
  cursor: pointer;

  &_raised {
    // box-shadow: 0px 10px 20px rgba(66, 72, 77, 0.2), 0px 9px 40px rgba(96, 189, 30, 0.2);

    &:hover,
    &:active {
      // box-shadow: 0px 4px 10px rgba(66, 72, 77, 0.1);
    }
  }

  &_outlined {
    background: inherit;
    // box-shadow: 0px 16px 25px rgba(66, 72, 77, 0.1);
    border-radius: 100px;
    color: $button-outlined-color;

    &:hover,
    &:active,
    &:focus {
      box-shadow: none;
    }
  }

  &_main-color {
    background-color: $button-main-color;
    color: $button-text-main-color;

    font-style: normal;
    font-weight: 600;
    font-size: 14/16 * 1rem;
    line-height: 24/16 * 1em;
    letter-spacing: 0.1px;

    &:hover,
    &:active {
      background-color: $hover-button-main-color;
    }
  }

  &_secondary-color {
    background-color: $button-secondary-color;
    color: $button-secondary-font-color;

    &:hover,
    &:active {
      background-color: $hover-button-secondary-color;
      color: $hover-button-secondary-font-color;
    }
  }
}
